    "2016-10-11T07:23:49.895079",nt"name": "tree-trimming-line-clearance-workload",nt"isopen":
    false,nt"url": null,nt"notes": "Vegetation Management is important for
    public safety and the reliability of the electric system. Austin Energy invests
    about $9 million annually in its Vegetation Management Program. A staff of 13 Austin
    Energy arborists and foresters oversee the program. Austin Energy contract crews
    currently trim trees citywide on a six-year cycle, trimming approximately 400 miles
    of power lines each year. About 50 crews (160 to 170 staff members) are in the field
    each day. There are approximately 2,400 miles of primary line to maintain. rnrnAustin
    Energy is one of the few utilities in the nation that attempts to meet with each
    property owner in advance of tree trimming. A plan detailing the trimming needed
    for each tree on a property is discussed and provided to the property owner for
    their acknowledgment and signature. When property owners refuse to meet or cooperate
    with scheduling, they receive a refusal letter which indicates when trimming will
    occur. The number of refusal letters is extremely small, less than 1% annually.",nt"license_title":
